    clean: true
  },
  module: {
    rules: [
      {
        test: /\.(ts|tsx)$/,
        use: [
          {
            loader: 'ts-loader',
            options: {
              getCustomTransformers: () => ({
                before: [isDevNotTest && ReactRefreshTypeScript()].filter(
                  Boolean
                )
              }),
              transpileOnly: isDev
            }
          }
        ],
        exclude: [/node_modules/]
      },
      {
        test: /\.(js|jsx)$/,
        use: [
          {
            loader: 'babel-loader',
            options: {
              configFile: path.join(rootDir, '/babel.config.js')
