                }
              }
            : {
                loader: 'style-loader',
                options: {
                  esModule: false
                }
              },
          'css-loader',
          'sass-loader'
        ]
      },
      {
        test: /\.(png|svg)$/,
        use: [
          {
            loader: 'file-loader',
            options: {
              name: 'img/[name].[ext]?[hash]'
            }
          }
        ]
      },
      {
        test: /(.json)/,
        type: 'asset/source'
      },
      { test: /\.json$/, type: 'json' }
    ]
  },
  plugins: [
    new ProgressPlugin(),
    new ProvidePlugin({}),
    new DefinePlugin({
      'process.env': {
        NODE_ENV: JSON.stringify(mode)
      }
    }),
    new HtmlWebpackPlugin({})
  ],
  resolve: {
    modules: ['src', 'node_modules'],
    alias: {
      '@': path.join(rootDir, '/src')
    },
    extensions: ['.js', '.jsx', '.json', '.css', '.ts', '.tsx', '.mjs']
  },
  optimization: {
    ...(isRelease
      ? {
          minimize: true,
          minimizer: [
            new TerserPlugin({
              parallel: true,
              terserOptions: {
                compress: {
                  drop_console: isRelease
